import styled from "styled-components";
import 'bootstrap/dist/css/bootstrap.min.css';

export const Divisao = styled.div`
  padding-top: 10px;
  display: flex;
  align-items: center;
  justify-content: center;
  flex-direction: column;
`;

export const WinsLayout = styled.div`
  display: flex;
`;
